import React from 'react';
import s from './Users.module.css';


const Users = (props) => {
    let users = props.users.map((u) => <div key={u.id}>
        <span>{u.fullName}</span>
        <span>{u.ava}</span>
        <span>{u.status}</span>
        <span>{u.followed}</span>
        <span>{u.lacation.city}</span>
    </div>);
    return (
        <div>
            {users}
        </div>
    )
}

export default Users;
